import React, { useState, useEffect } from "react";
import Example from "./Example";
import {
  Container,
  Box,
  Button,
  Grid,
  RadioGroup,
  FormControlLabel,
  FormControl,
  FormLabel,
  Radio,
} from "@material-ui/core";
export default function User(props) {
  const [name, setName] = useState("");
  const [gender, setGender] = useState("");

  const onChangeName = (e) => {
    setName(e.target.value);
  };

  const onChangeGender = (e) => {
    setGender(e.target.value);
  };

  const checkName = () => {
    if (name.length < 2) {
      alert("이름 좀 똑바로 입력하세요.");
    } else {
      props.history.push("/example");
    }
  };
  <Box style={{ width: "100%" }}>
    return (
    <header>
      <h1>직업 가치관 검사</h1>
    </header>
    <label>
      {" "}
      이름:
      <input type="text" name="name" value={name} onChange={onChangeName} />
    </label>
    <br />
    <label>
      <input
        type="radio"
        name="gender"
        checked={gender === "female" ? true : false}
        value="female"
        onChange={onChangeGender}
      />
      여자
    </label>
    <br />
    <label>
      <input
        type="radio"
        name="gender"
        checked={gender === "male" ? true : false}
        value="male"
        onChange={onChangeGender}
      />
      남자
    </label>
    <br />
    <Button
      disabled={name == "" || gender == "" ? true : false}
      variant="contained"
      color="primary"
      onClick={checkName}
    >
      검사 시작
    </Button>
    );
  </Box>;
}
